import './App.css';

import { useState } from 'react';

function App() {

  const [hovered, setHovered] = useState(false);
  const toggleClass = ()=>{
    setHovered(!hovered);
  }

  return (
    <div className="App">
      <header className="App-header">

        <h1 className={!hovered ? 'uncoloured-head' : 'coloured-head'} onMouseEnter={toggleClass} onMouseLeave={toggleClass}>Dash</h1>
        <h1  className={!hovered ? 'coloured-head' : 'coloured-head-change'} onMouseEnter={toggleClass} onMouseLeave={toggleClass} >Board</h1>   
      </header>
    </div>
  );
}

export default App;
